import React from 'react';
import classNames from 'classnames';

const FooterContact = ({
  className,
  ...props
}) => {

  const classes = classNames(
    'footer-social',
    className
  );

  return (
    <div
      {...props}
      className={classes}
    >
       
    </div>
  );
}

export default FooterContact;
